import React from "react";

const Stores = () => {
  return (
    <div className="wrapper">
      <span></span>
      <div className="content">
        147 Shoreditch High St,
        <br />
        London E1 6JE
        <br />
        <p className="phone-number">+44 (0) 020 3848 8860</p>
        <br />
      </div>
      <div className="content">
        115a Regent's Park Rd,
        <br />
        London NW1 8UR
        <br />
        <p className="phone-number"> +44 020 7253 1644</p>
        <br />
      </div>
      <span></span>
    </div>
  );
};

export default Stores;
